window.bookSummaryJSON = "<p>For ex-Navy SEAL Jon Hayes, the super-powered \"costumes\" are just part of ordinary life in New York City, until the day his pregnant wife Melanie is senselessly killed in a clash between Captain Light and The Jade Shade.</p> <p>But as Hayes struggles to come to terms with his loss, and questions for the first time who the costumes are and where they come from, the once sharp lines of his reality begin to blur...</p> <p>If Hayes wants to uncover the shocking truth about the figures behind the costumes, and get justice for his fallen family, he'll have to step out of the background, and stop being a bystander.</p>"; 
